import React, { Component } from "react";

class Preview extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { cvData } = this.props;
    return (
      <div>
        <div>the first name is: {cvData.personal.firstName}</div>
        <div>the last name is: {cvData.lastName}</div>
        <div>the email is: {cvData.email}</div>
        <div>the number is: {cvData.phone}</div>
      </div>
    );
  }
}

export default Preview;
